import { Col, DatePicker, Row } from "antd";
import React from "react";
function Dashboard() {
  return (
    <div className="dashboard">
        <div className="date-picker-place">
            <Row>
              <Col span={8} className="col-date-picker-place">1</Col>
              <Col span={8} className="col-date-picker-place">1</Col>
              <Col span={8} className="col-date-picker-place">1</Col>
            </Row>
        </div>
    </div>
  );
}
export default Dashboard;
